pragma solidity ^0.8.0;

interface Xor {
    function getValue() external view returns (uint256);
    function setValue(uint value) external view returns (uint256);
}

contract IdSelector {
    function idSelector() external pure returns (bytes4) {
        return Xor.getValue.selector ^ Xor.getValue.selector ;
    }
}

